import {BrowserRouter, Route} from "react-router-dom";

import { Work } from './pages/Work';

function App() {
  return (
    <div className="App">



      <header className="App-header">
        <h1> suppper text</h1>

        <BrowserRouter>

        <Route path="/work"> <Work/> </Route>

      </BrowserRouter>
        <p>
          Hello.
        </p>

      </header>
    </div>
  );
}

export default App;
